{'id': 16813600, 'body': "Hi Nee, we unfortunately don't have any customers or support tickets matching the name left on this review Please write us at support@floatme.io we'd love to look into this for you. We do not charge any membership dues to accounts while they were on they waitlist. Membership dues are only charged once an account is activated by the member. 

Accounts can be closed at any time by visiting our self-service portal at: https://floatme.zendesk.com/hc/en-us/articles/360036075614-How-do-I-cancel-my-FloatMe-subscription

The only exception is if there is an active fraud investigation or an outstanding Float on the account that is not yet repaid.", 'modified': '2020-07-22T15:35:53Z'}

{'id': 17358461, 'body': 'Hi jayone30,

If you are having issues logging into your FloatMe account you may use either the reset password function or can contact customer support at floatme.zendesk.com or support@floatme.io

If your bank is not accepting your login credentials you may need to contact your bank directly.', 'modified': '2020-08-18T16:25:55Z'}

{'id': 16813927, 'body': 'Hi Holveck_henk,

Please feel free to contact us at support@floatme.io; we charge our $1.99 monthly membership just once a month so this sounds unusual- have you set up multiple accounts? This may be causing the issue.

If you no longer wish to have an account we offer an easy self-service process at: https://floatme.zendesk.com/hc/en-us/articles/360036075614-How-do-I-cancel-my-FloatMe-subscription', 'modified': '2020-07-22T15:54:43Z'}

{'id': 22246584, 'body': "Update:
Hi Msg checks, we're sorry to hear that concern. FloatMe does not charge any $30 fees- this may have been an NSF fee charged by your bank if a scheduled monthly membership payment or Float payment could not be processed due to the bank balance. We suggest reaching out to your bank to see if they can waive this for you (FloatMe does not have any role in determining these fees)- if you need assistance, please contact us at support@floatme.io with your account information.

Original: 2/25/21 Thank you for your review! Glad you like it! :)", 'modified': '2021-04-14T18:48:17Z'}
